import './App.css';
import React, { Component } from "react";
import FilteredList from './FilteredList';

const songs = [
  {title: "HIP", language: "Korean", artist: "MAMAMOO", singer: "Female", duration: 195, source : './hip.jpg', played : false, times_played: 0},
  {title: "TOP", language: "Korean", artist: "Stray Kids", singer: "Male", duration: 186, source: './top.jpg', played : false, times_played: 0},
  {title: "Blueming", language: "Korean", artist: "IU", singer: "Female", duration: 217, source: './blue.jpg', played : false, times_played: 0},
  {title: "Wake Me Up", language: "English", artist: "Avicii", singer: "Male", duration: 250, source: './wmu.jpg', played : false, times_played: 0},
  {title: "Rather Be", language: "English", artist: "Clean Bandit", singer: "Female", duration: 228, source: './rb.jpg', played : false, times_played: 0},
  {title: "Flamingo", language: "Japanese", artist: "Yonezu Kenshi", singer: "Male", duration: 196, source: './flamingo.jpg', played : false, times_played: 0},
  {title: "BL", language: "Japanese", artist: "Queen Bee", singer: "Other", duration: 193, source: './bl.jpg', played : false, times_played: 0},
  {title: "Night Diver", language: "Japanese", artist: "Miura Haruma", singer: "Male", duration: 203, source: '/nd.jpg', played : false, times_played: 0},
  {title: "Ready Steady", language: "Japanese", artist: "Giga", singer: "Other", duration: 209, source: './rs.jpg', played : false, times_played: 0},
  {title: "Sunflower", language: "Japanese", artist: "Orangestar", singer: "Female", duration: 214, source: './sunflower.jpg', played : false, times_played: 0},
  {title: "Nocturne", language: "Chinese", artist: "Jay Chou", singer: "Male", duration: 227, source: './noct.jpg', played : false, times_played: 0},
  {title: "Super star", language: "Chinese", artist: "SHE", singer: "Female", duration: 196, source: './superstar.jpg', played : false, times_played: 0}
];

export default class App extends React.Component{
  constructor(props){
    super(props);
  }

  render(){
    return(
      <div className = "wrapper">
        <div className = "selection">
        <h1 style={{ color: 'white' }}>Music Playlist</h1>
        <div><FilteredList list = {songs} /></div>
        </div>
        <div className = "playlist">
          <h3>Song Queue</h3>
        </div>
      </div>
    )
  }
}
